import { Component } from '@angular/core';
import { FormBuilder } from '@angular/forms';

@Component({
  selector: 'app-r-builder-login',
  templateUrl: './r-builder-login.component.html',
  styleUrls: ['./r-builder-login.component.css']
})
export class RBuilderLoginComponent {
  constructor(private fb: FormBuilder){

  }
  loginForm = this.fb.group({
    email:[null],
    password:[null]
  });
}
<form [formGroup]="loginForm">
    <input type="text" formControlName="email" placeholder="Enter Email"/>
    <input type="text" formControlName="password" placeholder="Enter Email"/>
</form>
